const generateInput = (n) => {
    const tokens = [];
    for (let i = 0; i < n; i++) {
        tokens.push(String(Math.floor(Math.random() * 200) - 100));
        if (i > 0 && Math.random() > 0.5) {
            tokens.push(['+', '-', '*'][Math.floor(Math.random() * 3)]);
        }
    }
    return [tokens];
};
